import React  from "react";
import PosteNote from "./PosteNote";
import PostVote from "./PosteVote";

function PosteList({posts})  {
    return <>
        {posts.map((post) =>
            <PosteNote post={post} ></PosteNote>,
            <PostVote tow={post} ></PostVote>
        )}
    </>
}

export default PosteList
